// Frontend example (React)
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const UnitTestList = () => {
  const [unitTests, setUnitTests] = useState([]);

  useEffect(() => {
    // Fetch unit tests from backend
    axios.get('http://localhost:3001/api/unit-tests')
      .then(response => setUnitTests(response.data))
      .catch(error => console.error('Error fetching unit tests:', error));
  }, []);

  return (
    <div>
      <h1>Unit Tests</h1>
      <ul>
        {unitTests.map((test, index) => (
          <li key={index}>{test.type} - {test.language} - {test.status}</li>
        ))}
      </ul>
    </div>
  );
};

export default UnitTestList;
